name: Ganbare Goemon - Neo Momoyama Bakufu no Odori (Japan)
sha1: 6f8745fecc3a5e7d4918c7a73353eb0726116ded

options:
  basename: mnsg
  platform: n64
  compiler: IDO

  header_encoding: word
  
  base_path: ./../../
  build_path: build/jp
  asm_path: asm/jp
  asset_path: assets/jp
  target_path: baserom.jp.decompressed.z64
  ld_script_path: mnsg.jp.ld
  symbol_addrs_path: symbol_addrs.jp.txt
  
  symbol_name_format: $VRAM_$ROM

  asm_function_macro: glabel
  asm_data_macro: dlabel
  asm_jtbl_label_macro: jlabel
  asm_end_label: endlabel

  find_file_boundaries: True
  migrate_rodata_to_functions: False

segments:
  - name: header
    type: header
    start: 0x0

  - name: ipl3
    type: textbin
    start: 0x40

  - name: entry
    type: code
    start: 0x1000
    vram: 0x80000400
    subalign: 16
    subsegments:
    - [0x1000, hasm, entry]

